import React, {Component} from 'react';
import './bot.css';

import Slider from "react-slick";


class Bot extends Component {
    render() {


        return (

            <div className="bot">
                <Slider {...settings}>
                    <div>
                        <h3>1</h3>
                    </div>
                    <div>
                        <h3>2</h3>
                    </div>
                    <div>
                        <h3>3</h3>
                    </div>
                    <div>
                        <h3>4</h3>
                    </div>
                    <div>
                        <h3>5</h3>
                    </div>
                    <div>
                        <h3>6</h3>
                    </div>
                </Slider>
            </div>
        )
    }
};

export default Bot;
